import React,{useRef,useState,useEffect} from 'react';
import logo from './logo.svg';
import './App.css';
import './style.css'
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from './pages/Home'
import Detail from './pages/Detail'
import Articles from './pages/Articles';
import AboutUs from './pages/AboutUs';
import ContactUs from './pages/Articles';

export default class App extends React.Component {

  render() {

    return (

    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />}></Route>
        <Route path="/detail/:id/:title" element={<Detail/>}></Route>
        <Route path="/tags/:id/:title" element={<Articles/>}></Route>
        <Route path="/search" element={<Articles/>}></Route>
        <Route path="/latest" element={<Articles/>}></Route>
        <Route path="/popular" element={<Articles/>}></Route>
      </Routes>
    </BrowserRouter>
    );
  }

}
